export const tickDistance = 106;

export const pageTimelineActor = (player: Player, actorMap: Record<string, BaseActor>) => {
  actorMap.pageTimelineActorRoadMapText = player.createActor<VRenderTextActor>(ActorType.vrenderText, {
    name: 'roadMapText',
    defaultAttribute: {
      text: 'DEVELOPMENT ROADMAP',
      fontSize: 12,
      x: 110,
      y: 80,
      fill: 'black',
      textBaseline: 'top',
      textAlign: 'left',
      opacity: 0
    }
  });

  actorMap.pageTimelineActorTimeline = player.createActor<VRenderLineActor>(ActorType.vrenderLine, {
    name: 'timeline',
    defaultAttribute: {
      points: [
        { x: 110, y: 470 },
        { x: 110, y: 470 }
      ],
      stroke: lightBlack,
      lineWidth: 2,
      lineDash: [1, 1]
    }
  });

  actorMap.pageTimelineActorTimeProgress = player.createActor<VRenderLineActor>(ActorType.vrenderLine, {
    name: 'timeProgress',
    defaultAttribute: {
      points: [
        { x: 110, y: 470 },
        { x: 110, y: 470 }
      ],
      stroke: highlightColor,
      lineWidth: 4
    }
  });

  chartPageKeys.map((keys, i) => {
    const keyList = array(keys);

    keyList.forEach((key, j) => {
      const tick = player.createActor<VRenderCircleActor>(ActorType.vrenderCircle, {
        name: 'timeTick' + key,
        defaultAttribute: {
          startAngle: 0,
          endAngle: Math.PI * 2,
          radius: j === 0 ? 6 : 4,
          x: 110 + (i + 0.5 + j / keyList.length) * tickDistance,
          y: 470,
          fill: lightBlack,
          opacity: 0
        }
      });
      actorMap[`pageTimelineActorTimeTick${key}`] = tick;
    });

    const key = keyList[0];
    const label = player.createActor<VRenderPathActor>(ActorType.vrenderPath, {
      name: 'timeLabel' + key,
      defaultAttribute: {
        path: tickSvgMap[key].path,
        fill: lightBlack,
        x: 110 + (i + 0.5) * tickDistance - tickSvgMap[key].size[0] / 2,
        y: 490,
        opacity: 0
      }
    });
    actorMap[`pageTimelineActorTimeLabel${key}`] = label;
  });
};
